import React from "react";
import '../Assets/Styles/MenuComponentStyles.css'
import MenuButtonComponent from "./MenuButtonComponent";

function MenuComponent(props){
    return(
        <div className="menu-container">
            <MenuButtonComponent msj="Projects" onClick={() => props.setSelectedPage('Projects')}></MenuButtonComponent>
            <MenuButtonComponent msj="More Info " onClick={() => props.setSelectedPage('MoreInfo')}></MenuButtonComponent>
            <MenuButtonComponent msj="Contact me" onClick={() => props.setSelectedPage('ContactMe')}></MenuButtonComponent>
        </div>
    );
}

export default MenuComponent;
